import React from 'react';



const Number = (props) => (
  <React.Fragment>
    <input
      type="text" value={props.imdb}
      placeholder = {props.label}
      onChange={props.handleChange}
      name={props.name}
    />
  </React.Fragment>
);

export default Number;
